import React from "react";

const AlmostDone = () => {
  return (
    <>
      <div className="project-div2">
        <div>
          <h2> Awesome! We are almost done</h2>
        </div>

        <div className="project-div2-btn">
          <button>
            Continue <FaAngleRight />
          </button>
        </div>
      </div>
    </>
  );
};

export default AlmostDone;
